1\u043e\u044f\u0440\u0441\u043a\u0438\u0439 \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u0442\u0430\u043d\u0438\u0447\u043d\u043e\u0439 \u0438 \u0441\u0442\u043e\u0440\u043e\u0436\u0435\u0432\u043e\u0439 \u0441\u043b\u0443\u0436\u0431\u0435\">\u041f\u0440\u0438\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u0442\u0430\u043d\u0438\u0447\u043d\u043e\u0439 \u0438 \u0441\u0442\u043e\u0440\u043e\u0436\u0435\u0432\u043e\u0439 \u0441\u043b\u0443\u0436\u0431\u0435<\/a>\u00bb, \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u0430\u043d\u043d\u044b\u0439 \u0432\u043e\u0435\u0432\u043e\u0434\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%80%D0%BE%D1%82%D1%8B%D0%BD%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0412\u043e\u0440\u043e\u0442\u044b\u043d\u0441\u043a\u0438\u0439, \u041c\u0438\u0445\u0430\u0438\u043b \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u041c\u0438\u0445\u0430\u0438\u043b\u043e\u043c \u0412\u043e\u0440\u043e\u0442\u044b\u043d\u0441\u043a\u0438\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1704_%D0%B3%D0%BE%D0%B4\" title=\"1704 \u0433\u043e\u0434\">1704<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%84%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_(1704)\" title=\"\u0412\u0430\u0440\u0448\u0430\u0432\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f (1704)\">\u0412\u0430\u0440\u0448\u0430\u0432\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f (1704)<\/a> \u043d\u0438\u0437\u043b\u043e\u0436\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82_%D0%A1%D0%B8%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9\" title=\"\u0410\u0432\u0433\u0443\u0441\u0442 \u0421\u0438\u043b\u044c\u043d\u044b\u0439\">\u0410\u0432\u0433\u0443\u0441\u0442\u0430 \u0421\u0438\u043b\u044c\u043d\u043e\u0433\u043e<\/a> \u0438 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D1%86%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B8%D0%B5\" title=\"\u041c\u0435\u0436\u0434\u0443\u0446\u0430\u0440\u0441\u0442\u0432\u0438\u0435\">\u0411\u0435\u0441\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u044c\u0435<\/a>, \u0447\u0442\u043e \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u043b\u043e \u043f\u0440\u0438\u0447\u0438\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B5_(1704%E2%80%941706)\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u041f\u043e\u043b\u044c\u0448\u0435 (1704\u20141706)\">\u0413\u0440\u0430\u0436\u0434\u0430\u043dc\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0432 \u041f\u043e\u043b\u044c\u0448\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1837_%D0%B3%D0%BE%D0%B4\" title=\"1837 \u0433\u043e\u0434\">1837<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D0%B5%D0%BA%D1%80%D1%83%D1%88%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041a\u043e\u0440\u0430\u0431\u043b\u0435\u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0435\">\u043a\u043e\u0440\u0430\u0431\u043b\u0435\u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0438<\/a> \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D1%83%D1%81%D0%BD%D0%BE%D0%B5_%D1%81%D1%83%D0%B4%D0%BD%D0%BE\" title=\"\u041f\u0430\u0440\u0443\u0441\u043d\u043e\u0435 \u0441\u0443\u0434\u043d\u043e\">\u043f\u0430\u0440\u0443\u0441\u043d\u0438\u043a\u0430<\/a> \u00abJane and Margaret\u00bb \u0431\u043b\u0438\u0437 <a href=\"htt