u0446\u0438\u0438 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0430<\/a> (\u041e\u042d\u0421) \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B3%D0%B5%D1%80%D0%B0%D0%BD\" title=\"\u0422\u0435\u0433\u0435\u0440\u0430\u043d\">\u0422\u0435\u0433\u0435\u0440\u0430\u043d\u0435<\/a> \u0432 \u0447\u043b\u0435\u043d\u044b \u041e\u042d\u0421 \u043f\u0440\u0438\u043d\u044f\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD\" title=\"\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\">\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B7%D0%B1%D0%B5%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0423\u0437\u0431\u0435\u043a\u0438\u0441\u0442\u0430\u043d\">\u0423\u0437\u0431\u0435\u043a\u0438\u0441\u0442\u0430\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D0%BA%D0%BC%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u043a\u043c\u0435\u043d\u0438\u044f\">\u0422\u0443\u0440\u043a\u043c\u0435\u043d\u0438\u0441\u0442\u0430\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%B3%D0%B8%D0%B7%D0%B8%D1%8F\" title=\"\u041a\u0438\u0440\u0433\u0438\u0437\u0438\u044f\">\u041a\u0438\u0440\u0433\u0438\u0437\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B4%D0%B6%D0%B8%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d\">\u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1999_%D0%B3%D0%BE%D0%B4\" title=\"1999 \u0433\u043e\u0434\">1999<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D1%88%D0%BA%D0%B5%D0%BD%D1%82\" title=\"\u0422\u0430\